var CurrentCount = flow.get("Count")
if (!isNaN(msg.payload)) {
    var next = Number(msg.payload)
    if (next === 0) {
    } else {
        var CurrentAvg = flow.get("RollingAverage")
        var CurrentMax = flow.get("Max")
        var CurrentMin = flow.get("Min")
        var OldMax = CurrentMax
        var OldMin = CurrentMin
        if (CurrentCount === 0) {
            CurrentAvg = next;
            CurrentMin = next;
            CurrentMax = next;
            CurrentCount = CurrentCount + 1
        } else {
            oldtotal = CurrentAvg * CurrentCount
            newtotal = next + oldtotal
            CurrentCount = CurrentCount + 1
            CurrentAvg = newtotal / CurrentCount
            CurrentMax = Math.max(next, CurrentMax)
            if (CurrentMax != OldMax) {
                msg.NewMax = true
            }
            CurrentMin = Math.min(next, CurrentMin)
            if (CurrentMin != OldMin) {
                msg.NewMin = true
            }
        }
        flow.set("RollingAverage", CurrentAvg);
        flow.set("Max", CurrentMax);
        flow.set("Min", CurrentMin);
        flow.set("Count", CurrentCount);
        msg.next = next
        msg.RollingAverage = CurrentAvg;
        msg.Max = CurrentMax;
        msg.Min = CurrentMin;
        msg.Count = CurrentCount;
        return msg;
    }
}

