/*
 * This function is used by the Main recursive function (handlemsg) to decide whether to send the msg on as
 *  the msg.payload.value is atomic or if it needs to split the value into multiple msgs
 *
 */
function typeofhubitatvalue(value, source = "") {
    switch (typeof (value)) {
        case "number":
            //atomic just return the result of typeof
            return "number"
            break;
        case "bigint":
            //atomic just return the result of typeof
            return "bigint"
            break;
        case "boolean":
            //atomic just return the result of typeof
            return "boolean"
            break;
        case "string":
            //most splittable values are encoded strictly as text and so may be identified as a string

            //Fist check if the string is "valid" JSON
            if (isvalidJSONstring(value)) {
                //When it is "valid" JSON, check if it is splittable
                if (issplittablevalidJSONstring(value)) {
                    //When it is splittable, then return type as splittable JSON
                    return "splittable JSON"
                }
                else {
                    //if it is JSON, but not splittable ({}, "100, 100) return unsplittable JSON
                    return "unsplittable JSON"
                }
            }
            else {
                //When it isn't "valid" JSON, check if it is an array
                if (isvalidarray(value)) {
                    //When it is an array, check if it is splittable
                    if (issplittablearray(value)) {
                        //When it is splittable, return splittable Array
                        return "splittable Array"
                    }
                    else {
                        //if the array is not splittable (["apple"]) return unsplittable array
                        return "unsplittable array"
                    }
                }
                else {
                    //When it is neither JSON or Array, then it is really just a string, so return string
                    return "string"
                }
            }
            break;
        case "object":
            //some  splittable values are identified as objects

            //Fist check if the object is "valid" JSON
            if (isvalidJSONstring(value)) {
                //When it is "valid" JSON, check if it is splittable
                if (issplittablevalidJSONstring(value)) {
                    //When it is splittable, then return type as splittable JSON
                    return "splittable JSON"
                }
                else {
                    //if it is JSON, but not splittable ({}, "100, 100) return unsplittable JSON
                    return "unsplittable JSON"
                }
            }
            else {
                //When it isn't "valid" JSON, check if it is an array
                if (isvalidarray(value)) {
                    //When it is an array, check if it is splittable
                    if (issplittablearray(value)) {
                        //When it is splittable, return splittable Array
                        return "splittable Array"
                    }
                    else {
                        //if the array is not splittable (["apple"]) return unsplittable array
                        return "unsplittable array"
                    }
                }
                else {
                    //When it is neither JSON or Array, then I have not accounted for it. If you reach this point during an
                    //  investigation, it might be worth using the example that triggered your investigation to see if the object
                    //  is really just a string (without a triggering example I have not investigated)
                    return "object"
                }
            }
            break;
        default:
            //When the type is not one that I coded for then return unhandled because the situation is by definition unhandled
            return "unhandled"
            break;
    }
}

