}
msg2.topic = msg.exportableresults.Hub +"/"+msg.exportableresults.MQTTDeviceTopic+"/"+ msg.exportableresults.Measurement
//send the created combinedObj downstream (to the InfluxDB node), but only if the measurement is not null
if (!nullData) {
    return [msg, null]//msg2]
}

/*
This function is designed to care for the fact that the Hue 4 button 
green power button when paired to Zigbee2MQTT will sometimes send
1 message per button press and sometimes 2 messages.

This seems to happen because even thought the single action is sent,
the link quality is seen twice with the same last seen time.

This function is built to filter out the duplicate 2 message when
it is received. It does so by comparing the last seen time with
the last seen time that was stored in a context variable when the
last message was processed and throwing it away if it is a
duplicate.

When this was built, consideration was given to making it a generic
function that would do this filtering for all inputs. Because
there is no guarantee that different devices could generate
erroneous filtering, it is built to only do the filtering based
on a string that I will put in each Hue 4 button device's
MQTT name.

If this is used by someone else, they should update the first line
of code to reflect a string that will be unique for these devices.
As originally written, that is line 27.
*/

let h4CommonName = "Hue 4 option Button"
if (msg.topic.includes(h4CommonName)){
    let previousLastSeen = flow.get("last4ButtonSeen")
//    node.warn("4 Button")
    let startOfLabel = msg.payload.search('"last_seen":"');
//    node.warn(startOfLabel)
    var lastSeenString = msg.payload.substr(startOfLabel+13, 25);
//    node.warn(lastSeenString)
    if (previousLastSeen == lastSeenString){
        return
    }
    flow.set("last4ButtonSeen",lastSeenString)
}
return msg;

