                        msg.exportableresults.Value = "mobile"
                        break
                }
                break
            case "Owntracks Update Trigger":
                switch (msg.exportableresults.Value) {
                    case 'p':
                        msg.exportableresults.Value = "random ping"
                        break
                    case 'c':
                        msg.exportableresults.Value = "region entry/exit"
                        break
                    case 'b':
                        msg.exportableresults.Value = "beacon entry/exit"
                        break
                    case 'r':
                        msg.exportableresults.Value = "requested"
                        break
                    case 'u':
                        msg.exportableresults.Value = "user published"
                        break
                    case 't':
                        msg.exportableresults.Value = "timer based"
                        break
                    case 'v':
                        msg.exportableresults.Value = "settings update"
                        break
                }
                break
        }
    }
    showDebug ? node.warn("end of Simple") : null;
    showDebug ? node.warn(msg) : null;
    finalMsg =RED.util.cloneMessage(msg)
    !showDebug ? delete finalMsg.payload : null;
    !showDebug ? delete finalMsg.Source : null;
    !showDebug ? delete finalMsg._msgid : null;
    !showDebug ? delete finalMsg.simpleVsComplex : null;
    showDebug ? node.warn("About to send good update") : null;
    //msg.exportableresults = RED.util.cloneMessage(d[deviceID])
    return [finalMsg,null,null]
}

