/* This function takes input from the upstream processing 
    and creates an properly formated object to be sent to InfluxDB node via output 1 which will in turn write to the InfluxDB
    It also formats an MQTT topic and the data sending that to output 2 which in turn can be used by an MQTT node to send to 
    MQTT
 */
//gather the name of the device which had a reading that triggered the flow to be included as a tag (index) sent to InfluxDB
//note: this is the hubitat device ID or the DeviceID pulled from the table for other sources
var deviceID = msg.exportableresults.DeviceID;
//gather the name of the measurement that was sent by the device to be included as a tag (index) for invalid measurements and as the fieldname for valid measurements sent to InfluxDB
var typeOfMeasurement = msg.exportableresults.Measurement;

//gather the actual measurement value that was sent by the device to be included as the data for the field (when the measurement is valid) sent to InfluxDB
var theData = msg.exportableresults.Value;
//initialize the measurements object
var measurementsObj = {};

//initialize the tags (indices) object
var tagsObj = {};

//create the object that will later be used to combine the measurementsObj and tagsObj
var combinedObj;

//create the boolean that will be used to hold the evaluation of whether the measurement is valid or not
var validMeasurement;

//create the booleans that will be used to hold whether the reason a measurement is invalid is because it is a non-standard type or
// if the type of the measurement and the type passed from the device differ or
// if the value (data) is null
var nonStandardType = false;
var measurementTypeMismatch = false;
var nullData = false;

//create a boolean to keep track of if there are any tags (indices) that should be sent to the InfluxDB 
// it starts false but if any tag is valid then will become true. See below for what to send to InfluxDB based on valid measures and tags
var validTag = false;
if (msg.exportableresults.hasOwnProperty('dataType')){
    //! I am not sure that this if then else is even needed. I think it will probably now always recieve a valid measurement designation
    //if ((typeof theData == msg.exportableresults.dataType.toLowerCase()) || (msg.exportableresults.dataType == 'ENUM') || (theData === null))
    if ((typeof theData == msg.exportableresults.dataType.toLowerCase()) || (msg.exportableresults.dataType == 'ENUM') || (theData === null))
    {
        if (typeof theData == 'number')
        {
            node.status({ fill: "red", shape: "ring", text: "matched number" });
            if (!theData.isNaN)
            {
                validMeasurement = true;
            }
        }
        else if (typeof theData == 'string')
        {
            node.status({ fill: "red", shape: "ring", text: "matched string" });
            if (theData.length >= 0)
            {
                validMeasurement = true;
            }
        } 
        else if (typeof theData == 'boolean')
        {
            node.status({ fill: "red", shape: "ring", text: "matched boolean" });
            validMeasurement = true;
        }
        else if (msg.exportableresults.dataType == 'ENUM')
        { //This is checking to make sure the value matches one of the values in the ENUM from the device 
            node.status({ fill: "red", shape: "ring", text: msg.exportableresults.dataType + " matched ENUM" });
            msg.exportableresults.values.forEach(element => {
                if (flow.get(deviceID + element) == theData)
                {
                    validMeasurement = true;
                }
            })
        }
        else if (theData === null)
        {
            node.status({ fill: "red", shape: "ring", text: "matched null data" });
            nullData = true;
        }
        else
        {
            node.status({ fill: "red", shape: "ring", text: "matched nonstandardtype" });
            nonStandardType = true;
        }
    } //if ((typeof theData == msg.exportableresults.dataType.toLowerCase()) || (msg.exportableresults.dataType == 'ENUM') || (theData === null))
    else
    {
        node.status({ fill: "red", shape: "ring", text: "measurement type mismatch" });
        measurementTypeMismatch = true;
    } //else  if ((typeof theData == msg.exportableresults.dataType.toLowerCase()) || (msg.exportableresults.dataType == 'ENUM') || (theData === null))
}//if(msg.exportableresults.hasOwnProperty('dataType'))
else
{
    validMeasurement = true;
}// else      if(msg.exportableresults.hasOwnProperty('dataType')) else

//scanning all of the tags from the config node and creating a tag for that item if the entry on the config node has info
commonTags = ["House", "Floor", "Room", "Location", "DeviceType", "Manufacturer", "AccessProtocol", "PhysicalVirtualType","Hub"]
for (innerIndex = 0; innerIndex < commonTags.length; innerIndex++)
{
    if (msg.exportableresults.hasOwnProperty(commonTags[innerIndex]))
    {
        if (msg.exportableresults[commonTags[innerIndex]]===""){
            //node.warn("About to create empty influxDB tag")
        } else{
            tagsObj[commonTags[innerIndex]] = msg.exportableresults[commonTags[innerIndex]]
        }
    } //if (requestedDataTable[outerIndex][searchKeyIndices[innerIndex]] == searchValues[innerIndex]) else
} //for (innerIndex = 0; innerIndex < searchKeyIndices.length; innerIndex++)

//Based on whether or not the measurement is "valid" it either adds the device id to the tags or it goes to the else portion
if (validMeasurement) {
    measurementsObj[typeOfMeasurement] = theData;
    if (deviceID.length > 0) {
        tagsObj["DeviceID"] = deviceID;
        validTag = true;
    }
    if (validTag) {
        combinedObj = [measurementsObj, tagsObj]
    } else {
        //skip tags if none would be valid
        combinedObj = [measurementsObj]
    }
} else {
    //if the measeurement was not "valid", then it puts in a Generic measurement of true and tag it as either Non-Standard Type of Measurement Type Mismatch
    if (nonStandardType) {
        measurementsObj["Generic"] = true
        tagsObj["ReasonGeneric"] = "Non-Standard Type"
        tagsObj["Measure"] = typeOfMeasurement
    }
    if (deviceID.length > 0) {
        tagsObj["DeviceID"] = deviceID
        validTag = true
    }
    if (measurementTypeMismatch) {
        measurementsObj["Generic"] = true
        tagsObj["ReasonGeneric"] = "Measurement Type Mismatch"
        tagsObj["Measure"] = typeOfMeasurement
    }
    if (deviceID.length > 0) {
        tagsObj["DeviceID"] = deviceID
        validTag = true
    }
    combinedObj = [measurementsObj, tagsObj]
}
//put the object into the payload
msg.payload = combinedObj;
//build the status to be shown on the status of the subnode
msg.status = msg.exportableresults.Device + ": " + typeOfMeasurement + ": " + theData;

